window.bookSummaryJSON = "<p><b>One king caged my body. Another has caged my mind.</b></p> <p>War has broken out between Annwyn and Orea, though that's not the only battle being waged. There's a fight inside me, and it's one I'm determined to win, no matter how much they try to strip me down and hollow me out.</p> <p>Yet, they've forgotten one thing: the ancient magic of the pair bond. One can never truly be lost when two souls are already bound. Because Slade and I? We are connected by more than just fated magic, and we will always find each other. In any life.</p> <p>The fae king is trying to destroy me. My heritage. My memory. What he hasn't realized is this: gold bends, but stone breaks. And a Goldfinch does not fall. It flies.</p> <p><i>The seductive and thrilling BookTok hit dark fantasy romance series comes to an end in this powerful finale.</i> <i>Intended for mature listeners.</i></p> <p><i>Newly recorded in duet-style narration by Lilly Drake and Anthony Palmini.</i></p>"; 
